l meningkat Kriteria Hasil :Tingkat kesadaran meningkat Fungsi kognitif meningkat. Setelah dilakukan asuhan keperawatan 3x24 jam Kestabilan kadar glukosa darah meningkat Koordinasi meningkat, Kesadaran meningkat, Mengantuk menurun, Pusing menurun. Setelah dilakukan tindakan keperawatan 3x24 jam Toleransi Aktivitas Meningkat dengan kriteria hasil Kemudahan dalam melakukan aktivitas sehari-hari meningkat, Keluhan lelah menurun.', '', '', '', '', '', '', '', '', '1648', '1', '<b>Intervensi Mandiri:</b><div>Monitor saturasi oksigen, Identifikasi penyebab peningkatan TIK, Monitor TD, Monitor pelebaran tekanan nadi Monitor penurunan frekuensi jantung, Monitor ireguleritas irama napas, Monitor penurunan tingkat kesadaran, Identifikasi kemungkinan penyebab hiperglikemia, monitor kadar glukosa darah, monitor tanda dan gejala hiperglikemia. Monitor intake dan output cairan, Monitor kelelahan fisik dan emosional, Monitor pola dan jam tidur, Monitor lokasi dan ketidaknyamanan selama melakukan aktivitas, suction berkala, lakukan chest fisioterapi, mobilisasi berkala.</div><div><b><br></b></div><div><b>Intervensi Kolaborasi :</b></div><div>- Dari Dokter Jantung saran pasang CVC</div><div>- KGDH</div><div>- Insulin apidra 3x6 ui SC dosis koreksi, jika:</div><div>GDS<100><div>GDS 100-200: Dosis tetap</div><div>GDS 200-300: Dosis +3 UI</div><div>GDS >300: Dosis +5 UI</div><div>- Fisioterapi/ hari</div><div>- Post koreksi albumin 20 persen 50cc 2x</div><div>- post koreksi KCL 50 meq</div><div>- post extubasi tgl 28/2/25 jam 10.00</div><div>- Dexametason tapp off/ hari (minggu 1x5mg, senin stop)</div><div>- MPP (+)</div><div>- Rencana pinru albasia</div>', NULL, '1648', 0, NULL, '2025-03-01 13:12:37')
